private URI getRemoteURI() {
  if (fileURI != null) {
    return fileURI;
  } else if (pathPrefix == null) {
    return new Path(pathSuffix).toUri();
  } else {
    return new Path(pathPrefix, pathSuffix).toUri();
  }
}
